import React from 'react';
import { Routes, Route, Link, NavLink, useNavigate, BrowserRouter as Router } from 'react-router-dom';
import People from './People.js';
import Planets from './Planets.js';
import Films from './Film.js';
import './App.css';

function App() {

  return (
    <Routes>
      <Nav/>
      <Route path="/*" element={<App/>}/>
      <Route path="/people" element={<People />} />
      <Route path="/planet" element={<Planets />}/>
      <Route path="/film" element={<Films/>}/>
    </Routes>
  );
}



function Nav(){
  return(
    <nav>
      <li>Star Wars Home</li>
      <li>People</li>
      <li>Film</li>
      <li>Planets</li>
    </nav>
  );

}

export default App;
